export default function (...params) {
    const API = params[0];

    let data = "?";

    if (params[0]) {
        for (let key in params[0]) {
            data = `${data}${key}=${params[0][key]}&`;
        }
    }

    try {
        fetch(`${API}${data}`);
      } catch(err) {
        alert(err); // Failed to fetch
      }
}
